import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

var style = {
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "0",
    height: "60px",
    width: "100%",
}

var phantom = {
  display: 'block',
  padding: '20px',
  height: '60px',
  width: '100%',
}

function Footer() {
    return (
        <div>
            <div style={phantom} />
            <div style={style}>
            <Row className="rder-top bojustify-content-between p-3">
                        <Col className="p=0" md={3} sm={12}>
                            Copyright Bryan Ge 2020
                        </Col>
                        <Col className="p-0" d-flex justify-content-end md={2.5}>
                            Made with ❤️ in Dallas, TX!
                        </Col>
                    </Row>
            </div>
        </div>
    )
}

export default Footer

